function getTimeShowTime(dataDate) {
  return {
    type: "GET_TIME_SHOW_TIME",
    payload: dataDate,
  };
}
function showTimeOnMenu(data) {
  return {
    type: "SHOW_TIME",
    payload: data,
  };
}
export { getTimeShowTime };
